"original": |2-
     The IANA policy (using terms defined in [RFC5226]) for status-code
     extensions is Expert Review.  The IANA policy for vendor status-code
     extensions (codes 0x0n80 to 0x0nff, for n = 0 to 5) is First Come
     First Served.  Only status-code values in the range of 0x0n00 to
     0x0n7f can be registered in the IANA IPP registry.
"fixed": |-
  The IANA policy (using terms defined in [RFC5226]) for status-code extensions is Expert Review.  The IANA policy for vendor status-code extensions (codes 0x0n80 to 0x0nff, for n = 0 to 5) is First Come First Served.  Only status-code values in the range of 0x0n00 to 0x0n7f can be registered in the IANA IPP registry.
"ko": |-
  상태 코드 확장에 대한 IANA 정책([RFC5226]에 정의된 용어 사용)은 전문가 검토입니다. 공급업체 상태 코드 확장(코드 0x0n80 ~ 0x0nff, n = 0 ~ 5)에 대한 IANA 정책은 선착순입니다. 0x0n00 ~ 0x0n7f 범위의 상태 코드 값만 IANA IPP 레지스트리에 등록할 수 있습니다.
